import React from 'react';
import ReactDOM from 'react-dom';
import Button from 'react-bootstrap/Button'
import './index.css';
import RoundedImage from "react-rounded-image";
import SidebarImage from './images/logo192.png';
import {Container, Row, Col} from 'react-bootstrap';

class SideBar extends React.Component {
  render() {
    const sidebarStyle = {
      color: "black",
      backgroundColor: "white", 
      padding: "10px",
      fontFamily: "Arial",
      width: 200,
      height: 600,
    }
    return (
      <div className="sidebar" style={sidebarStyle}>
        <Container>
          <RoundedImage
             image={SidebarImage}
             imageWidth="150"
             imageHeight="150"
             roundedSize="13"
          />

          <div>
            <h3>Software Engineer</h3>
            <h4>B.S. Computer Science</h4>
          </div>


          <div>Welcome! kjhdsfkljahdsfkljahsdlfkjahsdfkljahsdfkljahdsfkljahdflkajsdfhalksdfhjalkdjfhalksdfhjalskdfjha </div>

          <div> <b>Links</b> <br/>
          </div>
        </Container>
    </div>
    );
  }
}

class Banner extends React.Component {
  render() {
    return <div className="banner">
    <h1> Patrick Wamsley </h1>
    <Button variant="outline-primary">See Projects</Button>{' '}
    </div>
  }
}

class HomeScreen extends React.Component {
  render() {
    return <div className="home_screen">
      <Banner />
      <SideBar />
    </div>
  }
}



ReactDOM.render(
  <HomeScreen />, 
  document.getElementById('root')
);
